import React from 'react';
import styled from 'styled-components';
import Navbar from '../components/Navbar';

const Container = styled.div`
  padding: 2rem;
  max-width: 800px;
  margin: 0 auto;
  text-align: center;
`;

const Title = styled.h1`
  font-size: 2.5rem;
  color: #002B5C;
  margin-bottom: 1rem;
`;

const Schedule = () => {
  return (
    <div>
      <Navbar />
      <Container>
        <Title>Schedule</Title>
        <p>Detailed bus schedules will be displayed here in the future.</p>
      </Container>
    </div>
  );
};

export default Schedule;
